import React from "react";
import "bulma/css/bulma.css";
import _ from "underscore";
import Banner  from './components/Banner'

class App extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      firstVar: "Our page loaded",
      secondVar: 50,
      name: 'Robert'
    }
  }
  componentDidMount() {
    setTimeout(() => {
      this.setState( { firstVar: 'Now it changed', name:'Bad'})
    }, 2000)

  }
  render() {
    return (
      <div>
        <Banner 
        firstVar={this.state.firstVar}
        name={this.state.name}
        />

      </div>
    )
  }
}

export default App;
